import React from 'react';
import { HeaderContainer, HeaderInner, HeaderMenu } from '../StyleComponents/StyleComponent';
import "../Style/Header.css";
function Header(props) {
    return (
        <HeaderContainer>
            <HeaderInner>
                <h1>이상혁</h1>
                <HeaderMenu>
                    <div className='HeaderMenuItem'>home</div>
                    <a href='sectionTwo'></a>
                    <div className='HeaderMenuItem'>about</div>
                    <div className='HeaderMenuItem'>skill</div>
                    <div className='HeaderMenuItem'>project</div>
                </HeaderMenu>
            </HeaderInner>
        </HeaderContainer>
    );
}

export default Header;
